import React, { useState, useCallback } from 'react';
import { GoogleMap, useJsApiLoader, Marker } from '@react-google-maps/api';
import axios from 'axios';
import './App.css';

const containerStyle = {
  width: '100%',
  height: '400px'
};

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [results, setResults] = useState([]);
  const [center, setCenter] = useState({ lat: 0, lng: 0 });
  const [error, setError] = useState('');

  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY
  });

  const [map, setMap] = useState(null);

  const onLoad = useCallback(function callback(map) {
    setMap(map);
  }, []);

  const onUnmount = useCallback(function callback(map) {
    setMap(null);
  }, []);

  const getCurrentLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setCenter({
            lat: position.coords.latitude,
            lng: position.coords.longitude
          });
        },
        (error) => {
          setError('Error getting location: ' + error.message);
        }
      );
    } else {
      setError('Geolocation is not supported by this browser.');
    }
  };

  const searchGroceryItems = async () => {
    if (!searchTerm.trim()) {
      setError('Please enter a search term');
      return;
    }

    try {
      const response = await axios.get('https://api.yelp.com/v3/businesses/search', {
        headers: {
          'Authorization': `Bearer ${process.env.REACT_APP_YELP_API_KEY}`
        },
        params: {
          term: searchTerm,
          latitude: center.lat,
          longitude: center.lng,
          radius: 1000, // 1km radius
          categories: 'grocery',
          sort_by: 'price'
        }
      });

      setResults(response.data.businesses);
      setError('');
    } catch (error) {
      setError('Error fetching results: ' + error.message);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-3xl font-bold text-center mb-8 text-blue-600">BluePie</h1>

        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <div className="flex gap-4 mb-4">
            <input
              type="text"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              placeholder="Search for grocery items..."
              className="flex-1 p-2 border rounded-lg"
            />
            <button
              onClick={getCurrentLocation}
              className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600"
            >
              Get Location
            </button>
            <button
              onClick={searchGroceryItems}
              className="bg-green-500 text-white px-4 py-2 rounded-lg hover:bg-green-600"
            >
              Search
            </button>
          </div>

          {error && <p className="text-red-500 mb-4">{error}</p>}

          {isLoaded && (
            <GoogleMap
              mapContainerStyle={containerStyle}
              center={center}
              zoom={15}
              onLoad={onLoad}
              onUnmount={onUnmount}
            >
              {results.map((business) => (
                <Marker
                  key={business.id}
                  position={{
                    lat: business.coordinates.latitude,
                    lng: business.coordinates.longitude
                  }}
                />
              ))}
            </GoogleMap>
          )}

          <div className="mt-6">
            {results.map((business) => (
              <div key={business.id} className="border-b py-4">
                <h3 className="text-xl font-semibold">{business.name}</h3>
                <p className="text-gray-600">{business.location.address1}</p>
                <p className="text-gray-600">Price Level: {business.price || 'N/A'}</p>
                <p className="text-gray-600">Rating: {business.rating} ‚≠ê</p>
                <p className="text-gray-600">Distance: {(business.distance / 1000).toFixed(2)} km</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
